export const Question = [
    {
      question: 'What exactly is this?',
      answer: 'This is a ......'
    },
    {
      question: 'How do I make payment?',
      answer: 'Payment will be required for coffee service only, cash is fine'
    },
    {
      question: 'Is my data secured?',
      answer: "Sure"
    }
  ];
